caption:
“Hvad så Arne? Er du klar til at sidde gammel og dement i en lift og sige “av av av”, blive tvunget til at skide i samme ble 24 timer i træk og høre dine pårørende blive bagtalt i dit nærvær? 
Nå ikke? Så må kom i gang, din dovne rad!” 
//Mette

Guderne ville, at vi i Kongeriget Danmark, skulle udstyres med en kulturminister, for hvem en middag på en midtsjællandsk filial af Bones med snaskeben og softice ad libitum, er det tætteste man kommer på kulturel orgasme. 
En kulturminister, der sidder derhjemme svøbt i 8 kilometer højskole-tørklæde, drikker Verdi og spiser Snøfler direkte fra pakken, alt imens hun ser Hit Med Sangen-kavalkade for Gud ved hvilken gang.. selvfølgelig i håb om at en af sangene, er fra hende yndlingsalbum: Absolute Music 2.
@joymogensen

